Recall that the definition of the  Plot  object is  type   Plot { TT : AbstractTrace } 
     data :: Vector { TT } 
     layout :: AbstractLayout 
     divid :: Base . Random . UUID  end   Given one or more  AbstractTrace s and optionally a  layout , we construct a Plot  object with any of the following constructors  # A blank canvas no traces or a layout  Plot ()  # A vector of traces and a layout  Plot { T : AbstractTrace }( data :: AbstractVector { T },   layout :: AbstractLayout )  # A vector of traces -- default layout supplied  Plot { T : AbstractTrace }( data :: AbstractVector { T })  # a single trace: will be put into a vector -- default layout supplied  Plot ( data :: AbstractTrace )  # a single trace and a layout (trace put into a vector)  Plot ( data :: AbstractTrace ,   layout :: AbstractLayout )   Notice that none of the recommended constructors have you pass the  divid 
field manually. This is an internal field used to allow the display and
unique identification of multiple plots in a single web page.

There are also a number of convenience methods to the  Plot  function that will
attempt to construct the traces for you. They have the following signatures  # Build a trace of type `kind` from x and y -- apply all kwargs to this trace  Plot ( x :: AbstractVector ,   y :: AbstractVector ,   l :: Layout = Layout ();   kind = scatter ,   kwargs ... )  # Build one trace of type `kind` for each column of the matrix `y`. Repeat the  # `x` argument for all traces. Apply `kwargs` identically to all traces  Plot ( x :: AbstractVector ,   y :: AbstractMatrix ,   l :: Layout = Layout ();   kind = scatter ,   kwargs ... )  # For `x` and `y` with the same number of columns, build one trace of type  # `kind` for each column pair, applying all `kwargs` identically do all traces  Plot ( x :: AbstractMatrix ,   y :: AbstractMatrix ,   l :: Layout = Layout ();   kind = scatter ,   kwargs ... )  # For any array of eltype `_Scalar` (really data, see PlotlyJS._Scalar), call  # the method `Plot(1:size(y, 1), y, l; kwargs...)` described above  Plot { T : _Scalar }( y :: AbstractArray { T },   l :: Layout = Layout ();   kwargs ... )  # Create one trace by applying `f` at 50 evenly spaced points from `x0` to `x1`  Plot ( f :: Function ,   x0 :: Number ,   x1 :: Number ,   l :: Layout = Layout ();   kwargs ... )  # Create one trace for each function `f ∈ fs` by applying `f` at 50 evenly  # spaced points from `x0` to `x1`  Plot ( fs :: AbstractVector { Function },   x0 :: Number ,   x1 :: Number ,   l :: Layout = Layout ();   kwargs ... )  # Construct one or more traces using data from the DataFrame `df` when possible  # If `group` is a symbol and that symbol matches one of the column names of  # `df`, make one trace for each unique value in the column `df[group]` (see  # example below)  Plot ( df :: AbstractDataFrame ,   l :: Layout = Layout ();   group = nothing ,   kwargs ... )  # Use the column `df[x]` as the x value on each trace. Similar for `y`  Plot ( df :: AbstractDataFrame ,   x :: Symbol ,   y :: Symbol ,   l :: Layout = Layout ();   group = nothing ,   kwargs ... )  # Use the column `df[y]` as the y value on each trace  Plot ( df :: AbstractDataFrame ,   y :: Symbol ,   l :: Layout = Layout ();   group = nothing ,   kwargs ... )   For more information on how these methods work please see the docstring for the Plot  function by calling  ?Plot  from the REPL.  Especially convenient is the  group  keyword argument when calling Plot(::AbstractDataFrame, ... ; ...) . Here is an example below:  julia   using   RDatasets  julia   iris   =   dataset ( datasets ,   iris );  julia   p   =   Plot ( iris ,   x =: SepalLength ,   y =: SepalWidth ,   mode = markers ,   marker_size = 8 ,   group =: Species )  data: [     scatter with fields marker, mode, name, type, x, and y ,     scatter with fields marker, mode, name, type, x, and y ,     scatter with fields marker, mode, name, type, x, and y  ]  layout:  layout with field margin   which would result in the following plot   
