The best way to think about styles is that they will apply default values for
attributes, only if the attribute is not already defined. For example, suppose
we had the following style:  goofy   =   Style ( global_trace = attr ( marker_color = red ), 
               trace = Dict ( : scatter   =   attr ( mode = markers )))   two plots:  p1   =   plot ( scatter ( y = 1 : 3 ,   mode = lines ,   marker_symbol = square ),   style = goofy )  p2   =   plot ( scatter ( y = 1 : 3 ,   marker_color = green ),   style = goofy )   If we inspect the json from these two plots we see:  julia  print(json(p1, 2))
{
   layout : {
     margin : {
       r : 50,
       l : 50,
       b : 50,
       t : 60
    }
  },
   data : [
    {
       y : [
        1,
        2,
        3
      ],
       type :  scatter ,
       mode :  lines ,
       marker : {
         symbol :  square ,
         color :  red 
      }
    }
  ]
}

julia  print(json(p2, 2))
{
   layout : {
     margin : {
       r : 50,
       l : 50,
       b : 50,
       t : 60
    }
  },
   data : [
    {
       y : [
        1,
        2,
        3
      ],
       type :  scatter ,
       marker : {
         color :  green 
      },
       mode :  markers 
    }
  ]
}  Notice that on p1:   the  marker.color  attribute was set to red  marker.symbol  remained square  mode  was not changed from  lines  to  markers .   On the other hand, in  p2  we see that the   mode  was set to  markers  marker.color  was not changed from green to red   This happened because the scatter in p1 defined the  mode  attribute, but not marker_color  whereas the scatter in p2 defined  marker_color  but not  mode .
In both cases the attributes inside the  Style  became a default value for
fields that were not already set inside the trace.
